export function Landing() {
    return (
    <>
      <div className="contain">
        <div className="Navbar">
         <nav class="navbar navbar-expand-sm bg-light navbar-light">
          <div className="logo"><img src={logo} className="logo"/></div>
          <div className="btn1"><button type="btn" className="btn btn-outline-primary">Log In</button></div>
         </nav>
        </div>
        <div className="Title1"><h1>WELCOME</h1></div>
        <div className="HomePage">
          <div className="banner-text">
             <h3>Lorem ipsum dolor sit amet consectetur adipisicing elit. Repellat similique numquam omnis dicta sequi ducimus voluptatum laboriosam illum maiores! Tempora et vero, cum autem odio veritatis libero fugiat doloribus! Quam!</h3>
